(function(){if(!window.StyleFix){return}var e=document.createElement("_").style,t=["vw","vh","vmin","vmax"].filter(function(t){e.width="";e.width="10"+t;return!e.width});if(!t.length){return}StyleFix.register(function(e){var n=innerWidth,r=innerHeight;return e.replace(RegExp("\\b(\\d+\\.?\\d*)("+t.join("|")+")\\b","gi"),function(e,t,i){switch(i){case"vw":return t*n/100+"px";case"vh":return t*r/100+"px";case"vmin":return t*Math.min(n,r)/100+"px";case"vmax":return t*Math.max(n,r)/100+"px"}})})})()